import Layout from "../components/Layout"

class ProjectPage extends React.Component{
  constructor(props){
    super(props)
    this.state = {}
  }
  render(){
    return (
      <Layout>
        <div className="project">
          <strong>Mikros</strong>
          <p>Mikros was a url shortner I made</p>
        </div>
      </Layout>
    )
  }
}

export default ProjectPage
